import React from "react";
import logo from "./img/Logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <section>
        <header>
          <img src={logo} width={40} alt="Logo" />
        </header>
        <main>
          <h1>Fun facts about React</h1>
        </main>
      </section>
    </div>
  );
}

export default App;
